import React from 'react';

const ListGroup = (props) => {
    const { genres } = props;
    return (
        <div>
            <ul className="list-group">
                { genres.map(genre => <li className="list-group-item"></li>) }

            </ul>
        </div>
    );
};

export default ListGroup;
